pragma solidity >=0.5.0 <0.9.0;

contract Marketplace {
    string public name;
    uint public vehicleCount = 0;
    mapping(uint => Vehicle) public vehicles;

    struct Vehicle {
        string vin;
        string vehicleType;
        uint vehiclePricePerDay;
        address payable owner;
        string[] unaviableDates;
        uint numOfSeats;
        string gearboxType;
    }

    event VehicleCreated(
        string vin,
        string vehicleType,
        uint vehiclePricePerDay,
        address payable owner,
        string[] unaviableDates,
        uint numOfSeats,
        string gearboxType
    );

    event VehiclePurchased(
        string vin,
        string vehicleType,
        uint vehiclePricePerDay,
        address payable owner,
        string[] unaviableDates,
        uint numOfSeats,
        string gearboxType
    );

    event VehicleRented(
        string vin,
        string vehicleType,
        uint vehiclePricePerDay,
        address payable owner,
        string[] unaviableDates,
        uint numOfSeats,
        string gearboxType
    );

    constructor() public {
        name = "Chen & Yarden final project";
    }

    function createVehicle(string memory _vin, string memory _vehicleType, uint _price, uint _numOfSeats, string memory _gearboxType) public {
        // Require a valid vin
        require(bytes(_vin).length > 0);
        // Require a valid price
        require(_price > 0);
        // Require a valid vehicle type
        require(bytes(_vehicleType).length > 0);
        // Require a valid number of seats in the vehicle
        require(_numOfSeats > 0);
        // Require a valid gearbox type
        require(bytes(_gearboxType).length > 0);
        // Increment Vehicle count
        vehicleCount++;
        // Create the Vehicle
        vehicles[vehicleCount] = Vehicle(
            _vin,
            _vehicleType,
            _price,
            payable(msg.sender),
            new string[](0),
            _numOfSeats,
            _gearboxType
        );
        // Trigger an event
        emit VehicleCreated(
            _vin,
            _vehicleType,
            _price,
            payable(msg.sender),
            new string[](0),
            _numOfSeats,
            _gearboxType
        );
    }

